const buttonForPasswordArray = [{
  className: 'entranceButton',
  handleButtonClick: true,
  onEnter: false,
  onLogin: false,
  text: 'Отправить',
},
{
  className: 'forgotPasswordButton',
  handleButtonClick: false,
  onEnter: true,
  onLogin: true,
  text: 'Войти',
},
{
  className: 'registrationButton',
  handleButtonClick: false,
  onEnter: false,
  onLogin: true,
  text: 'Регистрация',
}];

export default buttonForPasswordArray;
